import React, { useEffect, useState } from "react";
import { currencies } from "../../API/api";

const CoinPagination = () => {
  const [totalCoins, setTotalCoins] = useState([]);
  const [pages, setPage] = useState([]);

  useEffect(() => {
    //debugger
    return currencies()
      .then((res) => {
        setTotalCoins(res.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, [0]);

  useEffect(() => {
    setPage(totalCoins.length);
  }, [totalCoins]);

  const amountOfPages = []

  for(let i = 1; i < totalCoins.length/100; i++){
    amountOfPages.push(i)
  }

  let PaginationEl = amountOfPages.map(el => <li>el</li>)
  return <div>
      
  </div>;
};

export default CoinPagination;
